import React from "react";
import { Paper, Tabs, Tab } from "@material-ui/core";

class Header extends React.Component {
    render() {
        return (
            <Paper >
                <Tabs
                    value={value}
                    onChange={handleChange}
                    indicatorColor="primary"
                    textColor="primary"
                    centered
                >
                    <Tab label="Item One" />
                    <Tab label="Item Two" />
                    <Tab label="Item Three" />
                </Tabs>
            </Paper>
        );
    }
}

export default Header;
